BEGIN TRANSACTION;
DROP TABLE IF EXISTS `life_pattern`;
CREATE TABLE IF NOT EXISTS `life_pattern` (
	`date`	INTEGER NOT NULL,
	`milk`	INTEGER,
	`burp`	INTEGER,
	`pee`	INTEGER,
	`feces`	INTEGER,
	`bath`	INTEGER,
	`cream`	INTEGER,
	`height`	TEXT,
	`weight`	TEXT,
	`desc`	TEXT,
	PRIMARY KEY(`date`)
);
COMMIT;
